INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 7001, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "キャル", 0, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 7002, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "コッコロ", 0, 7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 7003, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "ペコリーヌ", 0, 7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 10001, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "キャル", 0, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 10002, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "コッコロ", 0, 10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 10003, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "ペコリーヌ", 0, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 12001, "2030/12/17 14:59:59", 0.0, -416.5, 0.0, 0, "ペコリーヌ", 0, 12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 13001, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "キャル", 0, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 13002, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "コッコロ", 0, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 13003, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "ペコリーヌ", 0, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 14001, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "キャル", 0, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 14002, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "コッコロ", 0, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 14003, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "ペコリーヌ", 0, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 15001, "2030/12/17 14:59:59", 0.0, -470.0, 0.0, 0, "コッコロ", 0, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 16001, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "キャル", 0, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 16002, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "コッコロ", 0, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 16003, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "ペコリーヌ", 0, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 17002, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "コッコロ", 0, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 17004, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "キャル", 0, 25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 17005, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "コッコロ", 0, 25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 17006, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "ペコリーヌ", 0, 25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 18001, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "カリン", 0, 18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 18002, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "カリン", 0, 18, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 2, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 19001, "2030/12/17 14:59:59", 0.0, -470.0, 0.0, 0, "カリン", 0, 19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 3, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 19002, "2030/12/17 14:59:59", 0.0, -470.0, 0.0, 0, "カリン", 0, 19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 4, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 20001, "2030/12/17 14:59:59", 0.0, -470.0, 0.0, 0, "カリン", 0, 20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 5, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 20002, "2030/12/17 14:59:59", 0.0, -470.0, 0.0, 0, "カリン", 0, 20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 6, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 21001, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "キャル", 0, 21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 21002, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "コッコロ", 0, 21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 21003, "2030/12/17 14:59:59", 0.0, -363.0, 0.0, 0, "ペコリーヌ", 0, 21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 22001, "2030/12/17 14:59:59", 0.0, -430.0, 0.0, 0, "カリン", 0, 22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 22002, "2030/12/17 14:59:59", 0.0, -430.0, 0.0, 0, "カリン", 0, 22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 2, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 23001, "2030/12/17 14:59:59", 0.0, -430.0, 0.0, 0, "カリン", 0, 23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 3, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 23002, "2030/12/17 14:59:59", 0.0, -430.0, 0.0, 0, "カリン", 0, 23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 4, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (2, 1, 24001, "2030/12/17 14:59:59", 8.0, -385.0, 4.08, 10011, "エリコ（バレンタイン）", 0, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (2, 1, 24002, "2030/12/17 14:59:59", 8.0, -385.0, 5.0, 10011, "エリコ（バレンタイン）", 0, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (2, 1, 24003, "2030/12/17 14:59:59", 8.0, -385.0, 10.11, 10011, "エリコ（バレンタイン）", 0, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 3, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (2, 1, 24004, "2030/12/17 14:59:59", 8.0, -385.0, 4.0, 10011, "エリコ（バレンタイン）", 0, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (2, 1, 24005, "2030/12/17 14:59:59", 8.0, -385.0, 6.0, 10011, "エリコ（バレンタイン）", 0, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 5, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 24006, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 10011, "エリコ（バレンタイン）", 0, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 24007, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 10011, "エリコ（バレンタイン）", 0, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 7, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 24008, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 10011, "エリコ（バレンタイン）", 0, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 8, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 24009, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 10011, "エリコ（バレンタイン）", 0, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 9, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 24010, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 10011, "エリコ（バレンタイン）", 0, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (2, 1, 24011, "2030/12/17 14:59:59", 8.0, -385.0, 2.12, 10011, "シズル（バレンタイン）", 0, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, "2019/01/31 12:00:00", 109101);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (2, 5, 24012, "2030/12/17 14:59:59", 8.0, -385.0, 4.19, 10011, "シズル（バレンタイン）", 0, 24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, "2019/01/31 12:00:00", 109101);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (4, 2, 24013, "2030/12/17 14:59:59", 8.0, -385.0, 2.3, 10011, "シズル（バレンタイン）", 0, 24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 3, "2019/01/31 12:00:00", 109101);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 24014, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 10011, "シズル（バレンタイン）", 0, 24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 4, "2019/01/31 12:00:00", 109102);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (2, 5, 24015, "2030/12/17 14:59:59", 8.0, -385.0, 5.23, 10011, "シズル（バレンタイン）", 0, 24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, "2019/01/31 12:00:00", 109101);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (1, 1, 24016, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 10011, "シズル（バレンタイン）", 0, 24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 6, "2019/01/31 12:00:00", 109102);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (2, 1, 24017, "2030/12/17 14:59:59", 8.0, -385.0, 5.01, 10011, "シズル（バレンタイン）", 0, 24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 7, "2019/01/31 12:00:00", 109101);
